import React from 'react';
import {
  StyleSheet,
  View,
  Text
} from 'react-native';

const StartGameScreen = props => {
  return (
    <View style = {styles.screen}>
      <Text>Start a New Game!</Text>

    </View>
  );
};

const styles = StyleSheet.create({
  screen: {
    flex:1,
    padding: 10,
    alignItems: 'center',
    justifyContent: 'flex-start' //this is default as main axis is horizontal -left->right
  }
});

export default StartGameScreen;
